    implicit none
    real,dimension(1:45)::x
    real,dimension(0:4344)::c
    real::v
    ! ::::::::::::::::::::
    real,dimension(0:4344)::p

    call bemsav(x,p)
    v = dot_product(p,c)

    return
  end function emsav

